import React from 'react'
import {Link} from 'react-router-dom';

const headerStyle = {
    height: '7vh',
    border: "1px solid red",
    display: 'flex',
    justifyContent: 'space-around'
}

const logoStyle = {
    width: "30%",
    border: "1px solid green",
}

const itemStyle = {
  width: "70%",
  border: "1px solid blue",
  display: "flex",
  justifyContent: "flex-end",
};

const logoIndividual = {
  padding: "10px",
  color: "grey",
  cursor: "pointer",
  fontSize: "30"
};

const itemIndividualStyle = {
    cursor: "pointer",
    padding: "5px",
    color: "grey"
}


export default function Header() {
  return (
    <div style={headerStyle}>
      <div style={logoStyle}>
        <div style={logoIndividual}><Link to={'/'}>Logo</Link></div>
      </div>
      <div style={itemStyle}>
        <div style={itemIndividualStyle}><Link to={'/UserInfo'}>Add User</Link></div>
        <div style={itemIndividualStyle}>Edit</div>
        <div style={itemIndividualStyle}>Contact</div>
        <div style={itemIndividualStyle}>About</div>
      </div>
    </div>
  );
}
